&quot;Never Enough&quot; is a song by, the American heavy metal band, Five Finger Death Punch. It is a track on the re-release of their album The Way of the Fist. The song has peaked the Mainstream Rock Tracks charts at #9 so far. A video was just released, directed by Agata Alexander. This is 5FDP's second video for their album The Way of the Fist.

The video begins showing a black-haired woman with a heavily tattooed man in what seems to be some sort of bondage fetish. The man then leaves in a white car and kisses the woman goodbye. The car is shown stopped somewhere, and a young man gets into the car revealing a handgun. A black Mercedes is shown, and the driver buys drugs from an unknown person (seemingly heroin, as the Mercedes driver is seen torching a spoon with a lighter). The white car is shown pulling up to a gas station, and the two men don ski masks and rob the store. A police car approaches the black Mercedes with its lights on, and the man gets nervous until the cop car quickly drives past him. The man then drives to the gas station held up by the other two men earlier, and the police car that passed the Mercedes is already there. The man approaches the crime scene/caution tape and is stopped by the police, but the man reveals his own badge. A chalk outline is shown on the ground outside the store, but it is not shown who was killed. The woman with the black hair from the beginning of the video is shown looking into a mirror and removing a wig, revealing her natural blonde hair. The young man who brought the gun to the robbery is shown looking depressed on his bed, holding said gun. The man with the badge from the Mercedes puts his badge in a desk drawer and is shown also looking bothered/depressed, and has a picture of the young gunman (his son) on his desk. The video ends showing all three of the characters (woman, young man and cop) eating dinner together; the adulterous wife, the murdering son and the druggie cop are all family, and all seem to wear a facade of everything being normal and ok. The video ends with a family picture being burned. - Wikipedia

